import React from 'react';
import './App.css';
import Dialog from './Dialog/Dialog';
import Login from './Login/Login';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.logged = false;
  }

  onLog() {
  }

  render() {
    return (
    <div className="App">
      <header className="App-header"> 
          <Login onLog={this.onLog}></Login>      
          { this.logged ? <Dialog></Dialog> : ""}
      </header>

    </div>
  );
  }
}

export default App;
